use function WaughJ\TestHashItem\TestHashItemExists;

function testURLIsDebug() : bool
{
    return TestHashItemExists( $_POST, 'url', null ) === 'debug';
}

function getDebugData() : array
{
    $debug = DEBUG_DATA;
    foreach ( $debug as &$webpage )
    {
        $webpage[ 'all_valid' ] = testDebugAlts( $webpage[ 'alts' ] );
    }
    return $debug;
}

function testDebugAlts( $alts ) : bool
{
    foreach ( $alts as $alt )
    {
        if ( $alt[ 'is_valid' ] === false )
        {
            return false;
        }
    }
    return true;
}

